function Studymaterial() {
    return (
        <div className="m-5">
        <iframe
        src='https://pdfjs-express.s3-us-west-2.amazonaws.com/docs/choosing-a-pdf-viewer.pdf'
        style={{ width:"100%", height:"678px"}}></iframe>
        </div>
    )
}

export default Studymaterial
